Enables a job to be run within a Conda environment. import conda @conda.activate(environment="myenv")
task check_if_cuda_is_available(): python -c "import torch; print(torch.cuda.is_available())" You can use the returned path of conda.create_env as the environment argument. package env = conda.create_env(file="environment.yml")
@conda.activate(environment=$env) This can even be expressed with nested decorators: import std
import conda @conda.activate(environment="myenv")
@std.run(interpreter="python")
task check_if_cuda_is_available(): import torch print(torch.cuda.is_available()) Here we first wrap the script with a python interpreter, then dictate that this task should run within a Conda environment.

